import React, {Component} from "react";
import BookCard from "./BookCard";
import db from "./db";

export default class BookCards extends Component {
    render() {
        const bookItems = db[0].books

        return (
            <BookCard bookItems = {bookItems}>
            </BookCard>
        );
    }

}
